INSERT INTO app_public.film (id, title, episode_id, opening_crawl, director, producer, release_date) VALUES (1, E'A New Hope', 4, E'It is a period of civil war.\nRebel spaceships, striking\nfrom a hidden base, have won\ntheir first victory against\nthe evil Galactic Empire.\n\nDuring the battle, Rebel\nspies managed to steal secret\nplans to the Empire''s\nultimate weapon, the DEATH\nSTAR, an armored space\nstation with enough power\nto destroy an entire planet.\n\nPursued by the Empire''s\nsinister agents, Princess\nLeia races home aboard her\nstarship, custodian of the\nstolen plans that can save her\npeople and restore\nfreedom to the galaxy....', E'George Lucas', ARRAY[E'Gary Kurtz', E'Rick McCallum']::text[], '1977-05-25');
INSERT INTO app_public.film (id, title, episode_id, opening_crawl, director, producer, release_date) VALUES (2, E'The Empire Strikes Back', 5, E'It is a dark time for the\nRebellion. Although the Death\nStar has been destroyed,\nImperial troops have driven the\nRebel forces from their hidden\nbase and pursued them across\nthe galaxy.\n\nEvading the dreaded Imperial\nStarfleet, a group of freedom\nfighters led by Luke Skywalker\nhas established a new secret\nbase on the remote ice world\nof Hoth.\n\nThe evil lord Darth Vader,\nobsessed with finding young\nSkywalker, has dispatched\nthousands of remote probes into\nthe far reaches of space....', E'Irvin Kershner', ARRAY[E'Gary Kurtz', E'Rick McCallum']::text[], '1980-05-17');
INSERT INTO app_public.film (id, title, episode_id, opening_crawl, director, producer, release_date) VALUES (3, E'Return of the Jedi', 6, E'Luke Skywalker has returned to\nhis home planet of Tatooine in\nan attempt to rescue his\nfriend Han Solo from the\nclutches of the vile gangster\nJabba the Hutt.\n\nLittle does Luke know that the\nGALACTIC EMPIRE has secretly\nbegun construction on a new\narmored space station even\nmore powerful than the first\ndreaded Death Star.\n\nWhen completed, this ultimate\nweapon will spell certain doom\nfor the small band of rebels\nstruggling to restore freedom\nto the galaxy...', E'Richard Marquand', ARRAY[E'Howard G. Kazanjian', E'George Lucas', E'Rick McCallum']::text[], '1983-05-25');
INSERT INTO app_public.film (id, title, episode_id, opening_crawl, director, producer, release_date) VALUES (4, E'The Phantom Menace', 1, E'Turmoil has engulfed the\nGalactic Republic. The taxation\nof trade routes to outlying star\nsystems is in dispute.\n\nHoping to resolve the matter\nwith a blockade of deadly\nbattleships, the greedy Trade\nFederation has stopped all\nshipping to the small planet\nof Naboo.\n\nWhile the Congress of the\nRepublic endlessly debates\nthis alarming chain of events,\nthe Supreme Chancellor has\nsecretly dispatched two Jedi\nKnights, the guardians of\npeace and justice in the\ngalaxy, to settle the conflict....', E'George Lucas', ARRAY[E'Rick McCallum']::text[], '1999-05-19');
INSERT INTO app_public.film (id, title, episode_id, opening_crawl, director, producer, release_date) VALUES (5, E'Attack of the Clones', 2, E'There is unrest in the Galactic\nSenate. Several thousand solar\nsystems have declared their\nintentions to leave the Republic.\n\nThis separatist movement,\nunder the leadership of the\nmysterious Count Dooku, has\nmade it difficult for the limited\nnumber of Jedi Knights to maintain \npeace and order in the galaxy.\n\nSenator Amidala, the former\nQueen of Naboo, is returning\nto the Galactic Senate to vote\non the critical issue of creating\nan ARMY OF THE REPUBLIC\nto assist the overwhelmed\nJedi....', E'George Lucas', ARRAY[E'Rick McCallum']::text[], '2002-05-16');
INSERT INTO app_public.film (id, title, episode_id, opening_crawl, director, producer, release_date) VALUES (6, E'Revenge of the Sith', 3, E'War! The Republic is crumbling\nunder attacks by the ruthless\nSith Lord, Count Dooku.\nThere are heroes on both sides.\nEvil is everywhere.\n\nIn a stunning move, the\nfiendish droid leader, General\nGrievous, has swept into the\nRepublic capital and kidnapped\nChancellor Palpatine, leader of\nthe Galactic Senate.\n\nAs the Separatist Droid Army\nattempts to flee the besieged\ncapital with their valuable\nhostage, two Jedi Knights lead a\ndesperate mission to rescue the\ncaptive Chancellor....', E'George Lucas', ARRAY[E'Rick McCallum']::text[], '2005-05-19');
